    false,nt"url": null,nt"notes": "This annual narrative report for Mark Twain
    National Wildlife Refuge outlines Refuge accomplishments during the 1969 calendar
    year. The report begins by summarizing the habitat conditions during the year. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, and
    raptors- is also covered. The Refuge development and maintenance section discusses
    physical developments. Resource management is outlined; topics include grazing,
    fur harvesting, timber removal, and commercial fishing. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, hunting, violations, and safety.",nt"owner_org":
